(function() {
	'use strict';

	angular.module('app')
		.controller('AppCtrl', ['$scope', '$rootScope', '$state', '$document', 'appConfig', 'AuthenticationService', '$location', '$cookies', AppCtrl]);

	function AppCtrl($scope, $rootScope, $state, $document, appConfig, AuthenticationService, $location, $cookies) {
		$scope.pageTransitionOpts = appConfig.pageTransitionOpts;
		$scope.main = appConfig.main;
		$scope.color = appConfig.color;

		$scope.$watch('main', function(newVal, oldVal) {
			// if (newVal.menu !== oldVal.menu || newVal.layout !== oldVal.layout) {
			//     $rootScope.$broadcast('layout:changed');
			// }

			if (newVal.menu === 'horizontal' && oldVal.menu === 'vertical') {
				$rootScope.$broadcast('nav:reset');
			}
			if (newVal.fixedHeader === false && newVal.fixedSidebar === true) {
				if (oldVal.fixedHeader === false && oldVal.fixedSidebar === false) {
					$scope.main.fixedHeader = true;
					$scope.main.fixedSidebar = true;
				}
				if (oldVal.fixedHeader === true && oldVal.fixedSidebar === true) {
					$scope.main.fixedHeader = false;
					$scope.main.fixedSidebar = false;
				}
			}
			if (newVal.fixedSidebar === true) {
				$scope.main.fixedHeader = true;
			}
			if (newVal.fixedHeader === false) {
				$scope.main.fixedSidebar = false;
			}
		}, true);

		$scope.logout = function(){
			AuthenticationService.ClearCredentials();
		};
		$scope.userDetails = $rootScope.globals.userDetails;
		$rootScope.$on("$userDetailPopulated", function(detail){
			$scope.userDetails = $rootScope.globals.userDetails;
		});
		$rootScope.$on("$stateChangeSuccess", function(event, currentRoute, previousRoute) {
			$document.scrollTo(0, 0);
		});
		$rootScope.userCan = function(permission){
			if(!$rootScope || !$rootScope.globals || !$rootScope.globals.userDetails || !$rootScope.globals.userDetails.AccessLevelDetail){
				return false;
			}
			return $rootScope.globals.userDetails.AccessLevelDetail.indexOf(permission) > -1;
		}
		$rootScope.userCanEditProjects = function(){
			return $rootScope.userCan('Edit Existing Projects');
		}
		$rootScope.blockProjectEditing = function(){
			if($rootScope.userCanEditProjects()){
				return '';
			}
			setTimeout(function(){
				$('.page-project :input, .page-project select').prop('disabled', true).css({ pointerEvents: 'none' });
				$('.page-project .md-button').attr('disabled', '').css({ pointerEvents: 'none' }).attr('href', '#');
				$('.page-project md-contact-chips').prop('disabled', true).css({ pointerEvents: 'none' });
				$('.page-project md-select, .page-project md-option').attr('disabled', 'true').css({ pointerEvents: 'none' });
			}, 150);
			return '';
		};
		$rootScope.getMaxNumberOfUsers = function(){
			return 10;
		};

	}

})();

