(function() {
	'use strict';
	angular.module('app.dashboard')
		.controller('dashboardCtrl', ['$scope', '$rootScope', 'DataSyncService', '$timeout', '$location', dashboardCtrl]);

	function dashboardCtrl($scope, $rootScope, DataSyncService, $timeout, $location) {

		console.log('Dashboard Controller Instantiated');
		$scope.activeProjects = [];
		$scope.projectTimeline = [];
		$scope.scopeChange = 'UNCHANGED';
		$scope.scopeChanges = [];
		$scope.subordinates = [];
		$scope.costAvoidance = 0;
		$scope.costAvoidanceChar = '';
		$scope.timeTracking = 'ON TRACK';
		$scope.userDetails = $rootScope.globals.userDetails;
		$scope.userDetails.AccessLevelDetail = $scope.userDetails.AccessLevelDetail || [];
		if($scope.userDetails.AccessLevelDetail.indexOf('View Dashboard') === -1){
			return;
		}
		$rootScope.currentProject = {};
		$rootScope.contactList = {
			lastUpdate: '',
			contacts: []
		};
		DataSyncService.loadContacts(function(contacts) {
			$rootScope.contactList.contacts = contacts;
			$rootScope.contactList.lastUpdate = moment();
		});
		$rootScope.phaseDataModel = {
			'Define': {
				'completedTasks': 0,
				'totalTasks': 0
			},
			'Measure': {
				'completedTasks': 0,
				'totalTasks': 0
			},
			'Analyze': {
				'completedTasks': 0,
				'totalTasks': 0
			},
			'Improve': {
				'completedTasks': 0,
				'totalTasks': 0
			},
			'Control': {
				'completedTasks': 0,
				'totalTasks': 0
			}
		};
		$rootScope.phaseData = angular.copy($rootScope.phaseDataModel);
		DataSyncService.getUserSubordinates(function(response){
			var subs = [$rootScope.globals.userDetails.Id];
			if (response.success){
				for (var i = 0; response.data && i < response.data.length; i++){
					if (response.data[i].Id)
						subs.push(response.data[i].Id);
				}
			}
			$scope.subordinates = subs;
			var filter = [DataSyncService.buildFilter('CreatedBy',null,'anyof',subs),{'andor':'and'},DataSyncService.buildFilter('Status',null,'is','active')];
			DataSyncService.sync(DataSyncService.buildRequest('get', ['projects'],null,[filter]), function(response) {
				if (response.success) {
					$scope.activeProjects = response.data;
					if (typeof $scope.activeProjects != 'object') {
						$scope.activeProjects = [];
					}
					if (!($scope.activeProjects instanceof Array)) {
						$scope.activeProjects = [$scope.activeProjects];
					}
				} else {
					$scope.activeProjects = [];
				}
				$scope.getCostAvoidance();
				$scope.getTimeTrack();
				for (var i = 0; $scope.activeProjects && i < $scope.activeProjects.length; i++) {
					$scope.activeProjects[i].chart = {
						percent: Math.round($scope.activeProjects[i].CompletionPercentage),
						options: {
							animate: {
								duration: 1500,
								enabled: false
							},
							barColor: $scope.color.primary,
							lineCap: 'round',
							size: 120,
							lineWidth: 5
						}
					};
				}
			});
			$scope.getScopeChanges();
			$scope.getProjectTimeline(null);
		});
		$scope.getTimeTrack = function(){
			var t = 'ON TRACK';
			for (var i = 0; $scope.activeProjects && i < $scope.activeProjects.length; i++){
				var s = $scope.activeProjects[i];
				var reviewDates = {
					'Define':{'rd':moment(s.DefineReviewDate),'incomplete':0},
					'Measure':{'rd':moment(s.MeasureReviewDate),'incomplete':0},
					'Analyze':{'rd':moment(s.AnalyzeReviewDate),'incomplete':0},
					'Improve':{'rd':moment(s.ImproveReviewDate),'incomplete':0},
					'Control':{'rd':moment(s.ControlReviewDate),'incomplete':0}
				};
				for (var z = 0; s.PhaseData && z < s.PhaseData.length; z++){
					var p = s.PhaseData[z];
					if (p.Status !== 'complete'){
						var ddiff = moment().diff(reviewDates[p.PhaseName].rd,'days');
						if (ddiff > 0){
							t = 'OFF TRACK';
							break;
						}else{
							if (Math.abs(ddiff) <= reviewDates[p.PhaseName].incomplete){
								t = 'OFF TRACK';
								break;
							}
						}
						reviewDates[p.PhaseName].incomplete++;
					}
				}
				if (t == 'OFF TRACK'){
					break;
				}
			}
			$scope.timeTracking = t;
		};
		$scope.getCostAvoidance = function(){
			var ca = 0;
			for (var i = 0; $scope.activeProjects && i < $scope.activeProjects.length; i++){
				ca += parseInt($scope.activeProjects[i].BusinessImpactValue);
			}

			if (Math.abs(Number(ca)) > 1.0e+12){
				$scope.costAvoidance = Math.round((Math.abs(Number(ca)) / 1.0e+12) * 10)/10;
				$scope.costAvoidanceChar = 'tr';
				return;
			}
			if (Math.abs(Number(ca)) > 1.0e+9){
				$scope.costAvoidance = Math.round((Math.abs(Number(ca)) / 1.0e+9) * 10)/10;
				$scope.costAvoidanceChar = 'b';
				return;
			}
			if (Math.abs(Number(ca)) > 1.0e+6){
				$scope.costAvoidance = Math.round((Math.abs(Number(ca)) / 1.0e+6) * 10)/10;
				$scope.costAvoidanceChar = 'm';
				return;
			}
			if (Math.abs(Number(ca)) > 1.0e+3){
				$scope.costAvoidance = Math.round((Math.abs(Number(ca)) / 1.0e+3) * 10)/10;
				$scope.costAvoidanceChar = 'k';
				return;
			}else{
				$scope.costAvoidance = Math.round(Math.abs(Number(ca)) * 10)/10;
				return;
			}
		};
		$scope.getScopeChanges = function(){
			DataSyncService.getScopeChange($scope.subordinates, function(response){
				if (response.success){
					$scope.scopeChange = 'CHANGED';
					$scope.scopeChanges = response.data;
				}else{
					$scope.scopeChange = 'UNCHANGED';
				}
			});
		};
		$scope.getProjectTimeline = function(lastId){
			DataSyncService.getActionTimeline($scope.subordinates,lastId,function(response){
				if (response.success){
					$scope.buildProjectTimeline(response.data);
				}
			});
		};
		$scope.buildProjectTimeline = function(data){
			var lastDiff = null;
			var lastColorClass = 'btn-success';
			var colorClass = ['success','primary','info','warning','danger'];
			function getColorClass(f){
				var sel = lastColorClass;
				while (sel == lastColorClass){
					sel = colorClass[ Math.floor(Math.random() * 4)];
				}
				return f+sel;
			}
			for (var i = 0; data && i < data.length; i++){
				var ddiff = moment(data[i].DateTimeCreated, 'YYYYMMDD').diff(moment(),'days');
				if (ddiff === 0 && ddiff != lastDiff){
					$scope.projectTimeline.push({
						'BadgeColor': 'btn-success',
						'NewDay':'Today'
					});
					lastDiff = 0;
				}else if (ddiff === 1 && ddiff != lastDiff){
					$scope.projectTimeline.push({
						'BadgeColor': getColorClass('btn-'),
						'NewDay':'Yesterday'
					});
					lastDiff = 1;
				}else{
					if (ddiff != lastDiff){
						$scope.projectTimeline.push({
							'BadgeColor': getColorClass('btn-'),
							'NewDay': moment(data[i].DateTimeCreated).format('ll')
						});
						lastDiff = ddiff;
					}
				}
				if (data[i].Caption){
					$scope.projectTimeline.push({
						'ProjectId':data[i].ProjectId,
						'HeaderColor':getColorClass('text-'),
						'BadgeColor':getColorClass('btn-'),
						'DateTime': ((ddiff == 0) ? moment(data[i].DateTimeCreated).fromNow() : moment(data[i].DateTimeCreated).format('LT')),
						'Icon':data[i].Icon,
						'Caption':data[i].Caption,
						'isAlt': (i%2 === 0) ? false : true,
					});
				}
			}
		};

		// $scope.projectTimeline.push({
		// 	'ProjectId':'1',
		// 	'HeaderColor':'text-danger',
		// 	'BadgeColor':'btn-primary',
		// 	'DateTime':'3 Minutes Ago',
		// 	'Icon':'fa fa-asterisk',
		// 	'Caption':'Jane Doe Completed The Define Phase!'
		// });
		// $scope.projectTimeline.push({
		// 	'ProjectId':'1',
		// 	'HeaderColor':'text-warning',
		// 	'BadgeColor':'btn-info',
		// 	'DateTime':'25 Minutes Ago',
		// 	'Icon':'fa fa-clock-o',
		// 	'Caption':'Jane Doe Completed The Define Phase!'
		// });
		// $scope.projectTimeline.push({
		// 	'ProjectId':'1',
		// 	'HeaderColor':'text-info',
		// 	'BadgeColor':'btn-success',
		// 	'DateTime':'10 Hours Ago',
		// 	'Icon':'fa fa-check',
		// 	'Caption':'Jane Doe Completed The Define Phase!'
		// });
		// $scope.projectTimeline.push({
		// 	'BadgeColor':'btn-warning',
		// 	'NewDay':'Yesterday'
		// });
		// $scope.projectTimeline.push({
		// 	'ProjectId':'1',
		// 	'HeaderColor':'text-info',
		// 	'BadgeColor':'btn-danger',
		// 	'DateTime':'8:30 PM',
		// 	'Icon':'fa fa-envelope-o',
		// 	'Caption':'Jane Doe Completed The Define Phase!'
		// });
		$scope.animateElementIn = function($el) {
			$el.removeClass('timeline-hidden');
			$el.addClass('bounce-in');
		};

		// optional: not mandatory (uses angular-scroll-animate)
		$scope.animateElementOut = function($el) {
			$el.addClass('timeline-hidden');
			$el.removeClass('bounce-in');
		};
	}
})();

