(function() {
	'use strict';

	angular.module('app.layout')
		.controller('L6HeaderCtrl', ['$scope', '$rootScope', 'DataSyncService', '$location', '$timeout', '$http', L6HeaderCtrl]);

	function L6HeaderCtrl($scope, $rootScope, DataSyncService, $location, $timeout, $http) {
		// console.log('Layout Controller Instantiated');
		$scope.isDisabled = false;
		$scope.selectedItem = null;
		$scope.searchText = '';
		$scope.searchResults = [];
		$scope.lastSearchVal = '';
		$scope.userDetails = $rootScope.globals.userDetails;
		$scope.updateUserDetails = function(){
			$scope.userDetails = $rootScope.globals.userDetails;
			$scope.profileImage = ($scope.userDetails) ? $scope.userDetails.ProfileImageUrl : "/images/generic-profile.png";
		};
		$scope.updateUserDetails();
		setInterval($scope.updateUserDetails, 1000);
		$scope.querySearch = function(query) {
			if (query.length > 2) {
				if (query != $scope.lastSearchVal) {
					var filters = [];
					if (query.indexOf('PROJ') === 0) {
						var projId = query.slice(4, query.length);
						filters.push(DataSyncService.buildFilter('Id', null, 'is', projId));
					} else {
						filters.push(DataSyncService.buildFilter('Name', null, 'contains', query));
					}
					var promise = $http.post('https://api.l6elite.com', DataSyncService.buildRequest('get', ['projects'], null, [filters])).then(
						function(response) {
							$rootScope.$broadcast('preloader:hide');
							return response.data;
						},
						function(response) {
							$rootScope.$broadcast('preloader:hide');
							return [];
						}
					);
					return promise;
				}
			}
		};
		$rootScope.$on("$userDetailPopulated", function(detail){
			$scope.userDetails = $rootScope.globals.userDetails;
			$scope.profileImage = ($scope.userDetails) ? $scope.userDetails.ProfileImageUrl : "/images/generic-profile.png";
		});
		$scope.selectedItemChange = function(item) {
			if (item)
				$location.path('/project/' + item.Id);
		};
	}
})();

(function () {
    'use strict';

    angular.module('app.layout')
        .directive('uiPreloader', ['$rootScope', uiPreloader]);

    function uiPreloader($rootScope) {
        return {
            restrict: 'A',
            template:'<span class="bar"></span>',
            link: function(scope, el, attrs) {        
                el.addClass('preloaderbar hide');
                scope.$on('$stateChangeStart', function(event) {
                    el.removeClass('hide').addClass('active');
                });
                scope.$on('$stateChangeSuccess', function( event, toState, toParams, fromState ) {
                    event.targetScope.$watch('$viewContentLoaded', function(){
                        el.addClass('hide').removeClass('active');
                    })
                });

                scope.$on('preloader:active', function(event) {
                    el.removeClass('hide').addClass('active');
                });
                scope.$on('preloader:hide', function(event) {
                    el.addClass('hide').removeClass('active');
                });                
            }
        };        
    }
})(); 


