function populateMdContactVariable(userIdList, contacts) {
	'use strict';
	var ret = [];
	if (!(userIdList instanceof Array)) {
		userIdList = [userIdList];
	}
	for (var i = 0; userIdList && i < userIdList.length; i++) {
		userIdList[i] = parseInt(userIdList[i]);
	}
	for (var i = 0; contacts && i < contacts.length; i++) {
		if (userIdList.indexOf(parseInt(contacts[i].id)) !== -1) {
			ret.push(contacts[i]);
		}
	}
	return ret;
}

function loadWalkthrough() {
	'use strict';
	var walkthroughData = {};
	var stepPhaseComponent = '';
	var stepNum = 0;
	angular.forEach(document.querySelectorAll('.l6_step'), function(el, key) {
		if (stepPhaseComponent !== $(el).closest('[data-phase-component]').attr('data-phase-component')) {
			stepPhaseComponent = $(el).closest('[data-phase-component]').attr('data-phase-component');
			stepNum = 0;
		}
		if (!walkthroughData[stepPhaseComponent]) {
			walkthroughData[stepPhaseComponent] = {
				'steps': [],
				'currentStep': 0
			};
		}
		if (!($(el).hasClass('l6_spacer'))) {
			walkthroughData[stepPhaseComponent].steps.push(el);
			$(el).attr('data-step', stepNum);
			if (stepNum > 0) {
				$(el).hide();
			}
			stepNum++;
		}
	});
	return walkthroughData;
}

function validateField(e, dataModel) {
	'use strict';
	var curStep = $(e).closest('.l6_step').attr('data-step');
	var req = $(e).closest('.l6_step').attr('data-step-required');
	var isVerified = true;
	if (req) {
		req = req.split(',');
		for (var i = 0; i < req.length; i++) {
			if (req[i].indexOf('.')) {
				var tReq = req[i].split('.');
				var val = dataModel;
				for (var z = 0; tReq && z < tReq.length; z++) {
					val = val[tReq[z]];
				}
				if (!val) {
					isVerified = false;
				}
			} else {
				if (!dataModel[req[i]]) {
					isVerified = false;
				}
			}
		}
	}
	console.log('curStep', curStep, 'req', req, 'dataModel', dataModel, 'e', e, 'isVerified', isVerified)
	return {
		'currentStep': parseInt(curStep),
		'isVerified': isVerified
	};
}

function moveNextStep(walkthrough) {
	'use strict';
	if (walkthrough.steps[(walkthrough.currentStep + 1)]) {
		walkthrough.currentStep += 1;
		var elem = $(walkthrough.steps[walkthrough.currentStep]);
		var par = elem.parent();
		$(elem).show();
		setTimeout(function() {
			$('html, body').animate({
				scrollTop: elem.offset().top - 260
			}, 'slow');
		}, 100);
	}
	return walkthrough;
}

function resetWalkthrough(walkthrough) {
	'use strict';
	for (var i = 1; i < walkthrough.steps.length; i++) {
		$(walkthrough.steps[i]).hide();
	}
	walkthrough.currentStep = 0;
	return walkthrough;
}

function completePhaseComponent(phase, component, projectId, DataSyncService, callback) {
	'use strict';
	var pc = DataSyncService.getPhaseComponentDetail(phase, component);
	var nc = {};
	nc.Status = (pc.Status === 'working') ? 'complete' : 'working';

	var f = [DataSyncService.buildFilter('Id', null, 'is', pc.Id)];
	DataSyncService.sync(DataSyncService.buildRequest('update', ['phasecomponents'], null, [f], [nc]), function(response) {
		if (response.success) {
			DataSyncService.updatePhaseComponentDetail(pc.ProjectId, function(response) {
				callback(response);
			});
		} else {
			callback(response);
		}
	});
}

