					$scope.getRaciData();

					$scope.addRACIColumn = function() {
						var idx = 'New',
							z = 1;
						if ($scope.raciOwners.indexOf('New') != -1) {
							do {
								z++;
							} while ($scope.raciOwners.indexOf('New' + z) > -1);
							idx += z;
						}
						$scope.raciOwners.push(idx);
						for (var a in $scope.RACIData) {
							$scope.RACIData[a].data.push('');
						}
					};
					$scope.addRACILine = function(lineName) {
						var z = 1, idx = 'New';
						if (!lineName){
							if ($scope.RACIData.hasOwnProperty('New')) {
								do {
									z++;
								} while ($scope.RACIData.hasOwnProperty('New' + z));
								idx = idx + z;
							}
						}else{
							var idx = lineName;
						}
						$scope.RACIData[idx] = {
							'label': (lineName) ? lineName : 'New',
							'data': []
						};
						for (var i = 0; i < $scope.raciOwners.length; i++) {
							$scope.RACIData[idx].data.push('');
						}
					};
					$scope.deleteRaciRow = function(row){
						$scope.RACIData[row].isDeleted = true;
					};
					$scope.deleteRaciCol = function(idx){
						$scope.raciOwners.splice(idx,1);
						for (var r in $scope.RACIData){
							$scope.RACIData[r].data.splice(idx,1);
						}
					};
